              children: " \u0627\u0633\u0645 \u0627\u0644\u0644\u0648\u062D\u0629 : \u0627\u062D\u062A\u0641\u0627\u0644 \u0627\u0644\u0645\u0633\u0644\u0645\u064A\u0646 \u0641\u064A \u0627\u0644\u062C\u0632\u0627\u0626\u0631 \u0627\u0644\u0641\u0646\u0627\u0646 : \u0628\u064A\u064A\u0631 \u0623\u0648\u063A\u0633\u062A \u0631\u064A\u0646\u0648\u0627\u0631 \u0631\u064F\u0633\u0645\u062A \u0639\u0627\u0645 : 1881 \u0627\u0644\u0627\u0631\u062A\u0641\u0627\u0639 : 0.73 \u0645 \u0627\u0644\u0639\u0631\u0636 : 0.92 \u0645 \u062A\u0645 \u0628\u064A\u0639 \u0647\u0630\u0647 \u0627\u0644\u0644\u0648\u062D\u0629 \u0645\u0646 \u0642\u0650\u0628\u0644 \u0627\u0644\u0641\u0646\u0627\u0646 \u0631\u064A\u0646\u0648\u0627\u0631 \u0625\u0644\u0649 Durand-Ruel  \u0641\u064A \u0639\u0627\u0645 1892 \u061B \u062B\u0645 \u0627\u0634\u062A\u0631\u0627\u0647\u0627 \u0627\u0644\u0641\u0646\u0627\u0646 \u0643\u0644\u0648\u062F \u0645\u0648\u0646\u064A\u0647 \u0641\u064A \u0639\u0627\u0645 1900 \u061B \u0648 \u0641\u064A \u0639\u0627\u0645 1936 \u0642\u0627\u0645 \u0627\u0644\u0645\u0648\u0646\u0633\u0646\u064A\u0648\u0631 \u062C\u0648\u0631\u062C..."
