                          <p>
                          For sheer impact, its hard to top The Raft of the Medusa, in which Gricault took a contemporary news event and transformed it into a timeless icon. The backstory begins with the 1818 sinking of the French naval vessel off the coast of Africa, which left 147 sailors adrift on a hastily constructed raft. Of that number, only 15 remained after a 13-day ordeal at sea that included incidents of cannibalism among the desperate men.</p>
                         <p>For sheer impact, its hard to top The Raft of the Medusa, in which Gricault took a contemporary news event and transformed it into a timeless icon. The backstory begins with the 1818 sinking of the French naval vessel off the coast of Africa, which left 147 sailors adrift on a hastily constructed raft. Of that number, only 15 remained after a 13-day ordeal at sea that included incidents of cannibalism among the desperate men. The larger-than-life-size painting, distinguished by a dramatic pyramidal composition, captures the moment the rafts emaciated crew spots a rescue ship. Gricault undertook the massive canvas on his own, without anyone paying for it, and approached it much like an investigative reporter, interviewing survivors and making numerous detailed studies based on their testimony.</p></div>
